  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The chart lists the overall audit score
  of each sponsor audited and provides additional detail on the number of audit elements
  tested during each audit, the number of Corrective Actions Required (CARs) and Immediate
  Corrective Actions Required (ICARs), the date of the audit report, whether an enforcement
  action was taken as a result of the audit, and a status on the progress of the audit.
  The Downloads Section at the bottom of this page forhas a graphical representation
  comparing the overall audit scores of all audited sponsors in 2012, as well as graphs
  comparing sponsors scores in each of the program areas audited (e.g., Formulary,
  CDAG, ODAG, etc.).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
